import React, { createRef } from 'react';
import { Map, Marker, Popup, TileLayer } from 'react-leaflet'

class LatLongMap extends React.Component {

	constructor(props) {
		super(props)
	  	this.state = {
	    	center: [0, 0],
			zoom: 5,
	    	marker: null
	    }
	}

	mapRef = createRef()

	setMarker(marker) {
		console.log("New marker position: " + marker)
	}

	render() {
    	const marker = this.state.marker != null ? (
      		<Marker position={this.state.marker}>
        		<Popup>You are @ {this.state.marker.lat}, {this.state.marker.lon}</Popup>
      		</Marker>
    	) : null

    	return (
      		<Map
        		center={this.state.center}
        		ref={this.mapRef}
        		zoom={this.state.zoom}>
	       		<TileLayer
	          		attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
	          		url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
	        	/>
	        	{marker}
      		</Map>
    	)
  	}
}

function handleClick(num, lat, lon, latLongMap) {
	return () => {
		console.log("You clicked item " + num + ": " + lat + ", " + lon)
		console.log(latLongMap.setMarker)
		latLongMap.setMarker([lat, lon])
	}
}

const LatLongList = ({latLongs, latLongMap}) => {
	var num = -1;
	return <table>
		<tbody>
			{latLongs.map(latLong => {
				num = num + 1
				var lat = latLong.latitude
				var lon = latLong.longitude
				return <tr key={lat + "," + lon}>
					<td onClick={handleClick(num, lat, lon, latLongMap)}>{lat + ", " + lon}</td>
				</tr>
				}
			)}
		</tbody>
    </table>
}

const LatLongsComponent = ({latLongs}) => {
	const latLongMap = <LatLongMap />
    return <table>
		<tbody>
			<tr>
				<td><LatLongList latLongs={latLongs} latLongMap={latLongMap}/></td>
				<td>{latLongMap}</td>
			</tr>
		</tbody>
    </table>
  }

export default LatLongsComponent;
